import React, { useState, useContext } from 'react';
import { useNavigate } from 'react-router-dom';
import { AuthContext } from '../contexts/AuthContext';

const PropertyForm = () => {
  const { authFetch } = useContext(AuthContext);
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    address: '',
    city: '',
    postalCode: '',
    type: 'apartment',
    landlordName: '',
    landlordEmail: '',
    landlordPhone: ''
  });

  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    try {
      const response = await authFetch('http://localhost:8080/api/properties', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify(formData)
      });

      if (!response.ok) {
        const data = await response.json();
        throw new Error(data.message || 'Mülk eklenirken bir hata oluştu');
      }

      navigate('/dashboard');
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div>
      <h1 className="text-2xl font-bold mb-6">Yeni Mülk Ekle</h1>

      {error && (
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-4">
          {error}
        </div>
      )}

      <div className="card max-w-2xl mx-auto">
        <form onSubmit={handleSubmit}>
          <div className="mb-4">
            <label htmlFor="address" className="form-label">Adres</label>
            <input
              type="text"
              id="address"
              name="address"
              value={formData.address}
              onChange={handleChange}
              required
              className="input-field"
              placeholder="Sokak, Bina No, Daire No"
            />
          </div>

          <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mb-4">
            <div>
              <label htmlFor="city" className="form-label">Şehir</label>
              <input
                type="text"
                id="city"
                name="city"
                value={formData.city}
                onChange={handleChange}
                required
                className="input-field"
              />
            </div>

            <div>
              <label htmlFor="postalCode" className="form-label">Posta Kodu</label>
              <input
                type="text"
                id="postalCode"
                name="postalCode"
                value={formData.postalCode}
                onChange={handleChange}
                className="input-field"
              />
            </div>
          </div>

          <div className="mb-4">
            <label htmlFor="type" className="form-label">Mülk Tipi</label>
            <select
              id="type"
              name="type"
              value={formData.type}
              onChange={handleChange}
              required
              className="input-field"
            >
              <option value="apartment">Daire</option>
              <option value="house">Müstakil Ev</option>
              <option value="villa">Villa</option>
              <option value="office">Ofis</option>
              <option value="store">Dükkan</option>
              <option value="other">Diğer</option>
            </select>
          </div>

          <hr className="my-6" />

          <h2 className="text-lg font-medium mb-4">Ev Sahibi Bilgileri</h2>

          <div className="mb-4">
            <label htmlFor="landlordName" className="form-label">Ev Sahibi Adı Soyadı</label>
            <input
              type="text"
              id="landlordName"
              name="landlordName"
              value={formData.landlordName}
              onChange={handleChange}
              required
              className="input-field"
            />
          </div>

          <div className="mb-4">
            <label htmlFor="landlordEmail" className="form-label">Ev Sahibi E-posta</label>
            <input
              type="email"
              id="landlordEmail"
              name="landlordEmail"
              value={formData.landlordEmail}
              onChange={handleChange}
              required
              className="input-field"
              placeholder="Rapor linki bu e-posta adresine gönderilecektir"
            />
          </div>

          <div className="mb-6">
            <label htmlFor="landlordPhone" className="form-label">Ev Sahibi Telefon (İsteğe Bağlı)</label>
            <input
              type="tel"
              id="landlordPhone"
              name="landlordPhone"
              value={formData.landlordPhone}
              onChange={handleChange}
              className="input-field"
            />
          </div>

          <div className="flex justify-end">
            <button 
              type="button" 
              onClick={() => navigate('/dashboard')}
              className="btn-secondary mr-3"
            >
              İptal
            </button>
            <button 
              type="submit" 
              disabled={loading} 
              className="btn-primary"
            >
              {loading ? 'Kaydediliyor...' : 'Kaydet'}
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default PropertyForm;
